import './HexagonGrid.css';

const imagePaths = [
  'Imagens/PAtiPiva.png',
    //   'images/image2.jpg',
    //   'images/image3.jpg',
    //   'images/image4.jpg',
    //   'images/image5.jpg',
    //   'images/image6.jpg',
];

function Hexagon() {
  return (
    <div className="hexagon-grid">
      {imagePaths.map((imagePath, index) => (
        <div className="hexagon" key={index}>
          <div className="hexagon-inner">
            <img src={process.env.PUBLIC_URL + '/' + imagePath} alt={`Image ${i}`} />
          </div>
        </div>
      ))}
    </div>
  );
}

export default Hexagon;
